window.bookSummaryJSON = "<p>Book seven in the ongoing <i>Wall Street Journal</i> best-selling Leveling Up series!</p> <p>After returning from the basajaunak lands, it's clear that Jessie and her crew need to find an alliance quickly. They need to head to Kingsley's in less than a couple of months. If they go as they are, they'll never be enough to save Austin's brother from total annihilation. Luckily, Jessie has a pile of connection requests waiting for her attention. The gargoyle cairns want to meet her. She has an opportunity to gain a little help. Unluckily, the cairns don't have much interest beyond meeting the new kid on the block.</p> <p>She must find a way to turn them to their cause. Time is ticking.</p>"; 
